let allCities;

const CitiesAndCodes = () => {
  fetch("http://localhost:3000/", {
    method: "GET",
    headers: { "Content-Type": "application/json" },
  })
    .then((response) => {
      return response.json(); // Parse JSON asynchronously
    })
    .then((data) => {
      console.log(data); // Log the received data
      allCities = data; // Assign data to allCities variable in the outer scope
      console.log(allCities); // Log the assigned data
    })
    .catch((error) => {
      console.error("Error fetching data:", error);
    });
    
};

export default CitiesAndCodes;
